import React from 'react';

const Header = () => {
  return (
    <header style={{ background: '#3498db', color: '#fff', padding: '20px', display: 'flex', justifyContent: 'space-between' }}>
      <h1>Perfil</h1>
      <img src="components/ronaldo.gif" alt="Imagen de Perfil" style={{ maxWidth: '200px', borderRadius: '50%' }} />
    </header>
  );
}

export default Header;
